import React from 'react';
import '../styles/character-animation.css';
import arbol from '../assets/imagenes/arbol.png';
import nube1 from '../assets/imagenes/nube1.png';
import nube2 from '../assets/imagenes/nube2.png';
import nube3 from '../assets/imagenes/nube3.png';

const CharacterScene: React.FC = () => {
    return (
        <div className="character-scene">
            {/* Nubes */}
            <div className="clouds">
                <img src={nube1} alt="cloud" className="cloud cloud-1" />
                <img src={nube2} alt="cloud" className="cloud cloud-2" />
                <img src={nube3} alt="cloud" className="cloud cloud-3" />
            </div>
            
            {/* Elementos del escenario */}
            <div className="scenery">
                <img src={arbol} alt="tree" className="tree tree-1" />
                <img src={arbol} alt="tree" className="tree tree-2" />
                <img src={arbol} alt="tree" className="tree tree-3" />
            </div>
            
            {/* Personaje caminando */}
            <div className="character">
                <div className="character-head">
                    <div className="character-eyes">
                        <span className="eye"></span>
                        <span className="eye"></span>
                    </div>
                </div>
                <div className="character-body"></div>
                <div className="character-legs">
                    <div className="leg leg-left"></div>
                    <div className="leg leg-right"></div>
                </div>
            </div>
            
            {/* Suelo animado */}
            <div className="ground"></div>
        </div>
    );
};

export default CharacterScene;
